import { Card, Icon, Image } from 'semantic-ui-react';
import React, { Component }  from 'react';



export default class ExecutiveBoard extends Component {
OFFICERS_FILE = '../data/Officers.csv';
IMAGES_PATH = '../data/images/';


  individualCard(name,graduation,title,email,image){



    return(
    <Card>
        <Image src='https://react.semantic-ui.com/images/avatar/large/matthew.png' wrapped ui={false} />
        <Card.Content>
        <Card.Header>name</Card.Header>
        <Card.Meta>
            <span className='graduation'>Class of graduation</span>
        </Card.Meta>
        <Card.Description>
            Matthew is a musician living in Nashville.
        </Card.Description>
        </Card.Content>
    </Card>
    )
}

    createCards(){
        d3.csv(this.OFFICERS_FILE, function(execBoard) {
            for (var i = 0; i < this.execBoard.length; i++){
                this.execBoardCards[i] = this.individualCard(this.execBoard.name,this.execBoard.graduation,this.execBoard.title,this.execBoard.email,this.IMAGES_PATH+this.execBoard.image);
              }
             return this.execBoardCards;
        });
 }
    render(){
        return(
            createCards()
        ) 
    }
}
